'use strict';
let Offer = require('./Offer.js');
//@@DocBrief("The builder of the Offer class")
class OfferBuilder extends Offer {
    setOfferId(offerId) {
        this.offerId = offerId;
    }
    setQuoteId(quoteId) {
        this.quoteId = quoteId;
    }
    setBid(bid) {
        this.bid = bid;
    }
    setAsk(ask) {
        this.ask = ask;
    }
    setBidTradable(bidTradable) {
        this.bidTradable = bidTradable;
    }
    setAskTradable(askTradable) {
        this.askTradable = askTradable;
    }
    setHigh(high) {
        this.high = high;
    }
    setLow(low) {
        this.low = low;
    }
    setVolume(volume) {
        this.volume = volume;
    }
    setTime(time) {
        this.time = time;
    }
    build() {
        return this;
    }
}
module.exports = OfferBuilder
